import axios from "axios";
import React, { useState, useEffect } from "react";



const UserProfiles = () => {

  const [UserProfiles, setUserProfiles] = useState([]);

  const fetchUserProfiles = () => {

    axios.get("http://localhost:8080/api/v1/users/1").then(res => {
      console.log(res);
      const data = res.data;
      setUserProfiles(res.data);
    });

  }

  useEffect(() => {
    fetchUserProfiles();
  }, []);


  return <h1>Hello</h1>

};


function App() {
  return (
    <div className="App">
      <UserProfiles />
    </div>
  );
}

export default App;
